import React from "react";

const Message = () => {
  return (
    <div>
      {display && (
        <div className={`flex flex-col w-screen`}>
          {display.map((team) => {
            return (
              <div>
                <p
                  class="bg-[#ffffff] border-[#000000] border-b-2 py-2 text-center mx-[32px] shadow-black shadow-md"
                  onClick={() => {
                    props.setTeam(team);
                    props.setOpen(false);
                  }}
                >
                  {team}
                </p>
              </div>
            );
          })}
        </div>
      )}
    </div>
  );
};

export default Message;
